var _story_ = {
    "1224": [
        {
            "_id": 1,
            "Story": "A spirited and quirky young girl who is into all the things girls her age are interested in, such as taking photos.<br>She was awakened from a piece of drifting eternal ice, only to find that she knows nothing about herself or her past. Though initially feeling dejected, she decided to name herself after the date of her rebirth.<br>And thus, on that day, March 7th was born."
        },
        {
            "_id": 2,
            "Story": "Why does March 7th take photos?<br><i>\"First of all, girls like me should like this kind of pastime.\"<br>\"Besides, I won't forget anything that I keep a photo of.\"</i><br><br>What has March 7th come to learn about photography?<br><i>\"Number one, when taking pictures of terrible cuisines, all the details must be clearly visible on the pictures because 'Taking pictures of food is equal to eating them. Every detail matters.'\"<br>\"Number two, as long as you take a picture with your eyes closed, you will be able to capture an expression of your subject with their eyes closed.\"</i><br><br>Why is March 7th always wearing her camera?<br><i>\"Because if anyone ever seals me away in ice again, at least I'll have my camera with me!\"</i><br><br>So why doesn't March 7th just use the camera on her phone?<br><i>\"Oh yeah, why not  hang on, it's because of that sense of formality!\"</i>"
        },
        {
            "_id": 3,
            "Story": "March 7th's ability is \"Six-Phased Ice,\" but she has always insisted that it is not ice but some kind of condensed crystal.<br><i>\"Come on, ice can't be this beautiful.\"</i><br><br>The bows and arrows March 7th uses in battle are also made of the Six-Phased Ice, but she is not satisfied with the fact that her weapon is a bow.<br><i>\"Great warriors never use bows!\"<br>\"Besides, if I use my ice arrow to attack my ice shield, nothing will happen at all!\"</i><br><br>March 7th has also worked hard to practice a unique skill called \"Starshatter: Shard Supreme,\" but she never succeeded.<br><i>\"March, judging by the name, it should be a greatsword, right?\"<br>\"Well, but it feels like it may not even be as good as an ice sculpture... Ugh.\"</i>"
        },
        {
            "_id": 4,
            "Story": "Compared to Pom-Pom the conductor, Himeko the Navigator, Dan Heng the Guard, and Welt the Jack-of-all-Trades, even March 7th has a hard time explaining her role aboard the Express despite calling herself a \"Warrior.\"<br>But March 7th's every move affects the crew's course of action all the time.<br><br><i>\"Passenger March 7th slipped and fell...\"<br>\"March, watch out for the galena ball above your head.\"<br>\"March, have you taken pictures of the sights over there?\"<br>\"I believe March. If she said it's not delicious, then it's truly not delectable.\"</i><br><br>Rather than calling March 7th someone who constantly worries people, it would be better to say that she works her way into people's hearts.<br>March 7th, of course, is oblivious to this, and is struggling to think up the right role for Trailblazer."
        },
        {
            "_id": 5,
            "Story": "For March 7th, who has been drifting in space, the situation in which she awoke isn't too bad.<br>She woke up on a passing train, and the people on the train looked friendly.<br>The only problem is that even though she has a reasonable understanding of what's going on around her, she still doesn't know anything about herself.<br><br><i>\"Who am I? Where do I come from...\" </i><br><br>March 7th looks at herself in the mirror, imagining dozens of potential past lives for herself as she tries on the various outfits that Himeko had assembled for her.<br>But she can't be sure what her past was like, and what kind of past a girl like her should have...<br>The only thing March 7th can choose to be is her current self, and the only thing she can look forward to is the future.<br>She is both frightened and glad."
        },
        {
            "_id": 21,
            "Story": "March 7th in a Xianzhou-styled outfit. A sword-wielding female martial artist.<br>Learning swordplay from both Yunli and Yanqing, she is eager to create more beautiful memories on the Xianzhou."
        },
        {
            "_id": 22,
            "Story": "Visiting the Luofu for the first time, the Ambrosial Arbor crisis, the Wardance... She not only bore witness to the Xianzhou ship's transformation, but also her own growth.<br>The girl in the photograph moved nimbly in the flower grove. Petals rained down as she wielded her sword with vigor, fluttering all over her robes.<br><br>Was she still the same March 7th from before? Her footwork had become skilled, and she carried herself with poise and composure. Before she knew it, she could already wield her dual swords with confidence... A minor achievement, but one that nevertheless transformed her into a person that she could hardly recognize.<br><i>\"...If I want to know who I really am, then I must find the truth myself.\"</i><br>She quietly made up her mind and turned her gaze to the sky, hope and anticipation filling her eyes. Countless stars and endless worlds gazed back upon her, twinkling in the sky as they did.<br><i>\"My past is growing bit by bit each and every day.\"</i><br><br>Indeed, for her past and future, both have gradually taken on new colors."
        }
    ]
}

